import React from "react";
import "../css/footer.css";
import instegram from "../Pictures/instegram.png";

function Footer() {
  return (
    <div className="bodyfooter">
      <img className="iconImg" src={instegram} />
      
    margin-left: -74%;
    margin-top: 8px;
    </div>
  );
}

export default Footer;
